import React from 'react';
import {Box, Typography,Table,TableBody,TableCell, TableContainer, TableHead, TableRow, Paper} from '@mui/material';
import { toWords } from 'number-to-words';

const FormComponentNMT = ({ 
  rollNumber = 'NMT2023001',
  name = 'Student Name',
  sod = "Parent's Name",
  examDate = 'June 2025',
  subjectsData = [
    {
      paperNo: 'I',
      subject: 'Anatomy, Physiology & Basic Chemistry, Physics and Maths',
      theoryMax: 100,
      theorySecured: 85,
      practicalMax: null,
      practicalSecured: null,
      totalMax: 100,
      totalSecured: 85,
      result: 'Pass'
    },
  ],
  specialty = 'Nuclear Medicine Technology'
}) => {
  const borderStyle = '1px solid #ddd';
  const headerBg = '#f5f5f5';

  const grandTotal = subjectsData.reduce((total, subject) => total + (subject.totalSecured || 0), 0);
  const totalInWords = toWords(grandTotal).replace(/,/g, ' ').toUpperCase();

  return (
    <Box sx={{ pt: 9, px: 6, pb: 7 }}>

      {/* Document Title */}
      <Typography variant="h6" sx={{ 
        fontWeight: 'bold', 
        mb: 3,
        textDecoration: 'underline'
      }}>
        MEMORANDUM OF MARKS
      </Typography>

      {/* Student Information */}
      <Box sx={{ mb: 3 }}>
        <Typography><strong>Roll No:</strong> {rollNumber}</Typography>
        <Typography variant="h6" sx={{ fontWeight: 'bold', my: 1 }}>
          Postgraduate Diploma in {specialty}
        </Typography>
        <Typography>
          First Year Final Examination held in the month of {examDate}
        </Typography>
        <Typography><strong>Name:</strong> {name}</Typography>
        <Typography><strong>S/O./D/O:</strong> {sod}</Typography>
      </Box>

      {/* Marks Table */}
      <TableContainer component={Paper} sx={{ mb: 2 }}>
        <Table size="medium" >
          <TableHead>
          <TableRow sx={{ backgroundColor: '#dddddd' }}>

              <TableCell sx={{ fontWeight: 'bold',  }}>Paper</TableCell>
              <TableCell sx={{ fontWeight: 'bold', }}>Subject</TableCell>
              <TableCell  align="center" colSpan={2} sx={{ fontWeight: 'bold',  }}>Theory</TableCell>
              <TableCell align="center" colSpan={2} sx={{ fontWeight: 'bold', }}>Practical/Viva</TableCell>
              <TableCell align="center" colSpan={2} sx={{ fontWeight: 'bold', }}>Total</TableCell>
            </TableRow>
            <TableRow sx={{ backgroundColor: '#dddddd' }}>

              <TableCell ></TableCell>
              <TableCell ></TableCell>
              <TableCell >Maximum Marks</TableCell>
              <TableCell >Marks Secured</TableCell>
              <TableCell >Maximum Marks</TableCell>
              <TableCell >Marks Secured</TableCell>
              <TableCell >Maximum Marks</TableCell>
              <TableCell >Marks Secured</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjectsData.map((subject, index) => (
              <TableRow key={index}>
                <TableCell >{subject.paperNo}</TableCell>
                <TableCell sx={{ wordBreak: 'break-word' }}>{subject.subject}</TableCell>
                <TableCell sx={{ wordBreak: 'break-word' }}>{subject.theoryMax}</TableCell>
                <TableCell sx={{ wordBreak: 'break-word' }} >{subject.theorySecured || '-'}</TableCell>
                <TableCell sx={{ wordBreak: 'break-word' }} >{subject.practicalMax || 'NA'}</TableCell>
                <TableCell>
                  {subject.practicalMax ? (subject.practicalSecured || '-') : 'NA'}
                </TableCell>
                <TableCell >{subject.totalMax}</TableCell>
                <TableCell>{subject.totalSecured || '-'}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* Footer Information */}
      <Box sx={{ mt: 2 }}>
        <Typography>
          <strong>Aggregate marks in words:</strong> {totalInWords}
        </Typography>
        <Typography sx={{ mt: 1 }}>
          <strong>Result:</strong> PASS
        </Typography>


      </Box>
    </Box>
  );
};

export default FormComponentNMT;
